# Brute force. Time: O(n^2). Space: O(1)
class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        max_length = 1 if len(s) > 0 else 0
        i, j = 0, 1
        while i < len(s):
            while j < len(s):
                if s[j] in s[i:j]:
                    i = s.rindex(s[j], i, j)
                    break
                max_length = max(j - i + 1, max_length)
                j += 1
            i += 1
        return max_length


# Sliding window. Time: O(n). Space: O(1)
class Solution2:
    def lengthOfLongestSubstring(self, s: str) -> int:
        start = -1
        max_length = 0
        mem = {}
        for i, c in enumerate(s):
            start = max(mem.get(c, start), start)
            max_length = max(max_length, i - start)
            mem[c] = i
        return max_length


